import React from "react";
import { Jumbotron, Container } from "react-bootstrap";

function Home() {
    return (
        <Jumbotron fluid className="text-center">
            <Container>
                <h1 className="display-3">The World of Westeros</h1>
            </Container>
        </Jumbotron>
    );
}

export default Home;
